$(document).ready(function(){

	$('#btnFetch').click(function(){
		FB.api('/me/posts', function(response) {
			var result = JSON.stringify(response, null, 4);
			var resultShort = JSON.stringify(response);
			$('#outputRawData').html("<pre><code>" + result + "</code></pre>" + resultShort);
			//$('#outputRawData').html(resultShort);
			doLogic(response);
		});
	});
	
	$('#btn').click(function() {
		$('#outputRawData2').html(btoa($('#outputRawData').html));
	});
	
	$('#btnFetchLocal').click(function() {
		var localData = '';
		var temp = atob(localData);
		var obj = JSON.parse(temp);
		var result = JSON.stringify(obj, null, 4);
		$('#outputRawData').html("<pre><code>" + result + "</code></pre>");
		doLogic(obj);
	});
	
});

function doLogic(response) {
	
	var outStr = "";
	
	for (var i=0; i<response.data.length; i++) {
		outStr += i + ". " + response.data[i].type;
		
		if (response.data[i].type == "link" || response.data[i].type == "video" || response.data[i].type == "swf") {
			outStr += ": " + response.data[i].message + " | ";
			outStr += "name: " + response.data[i].name + " | ";
			outStr += "link: <a href='" + response.data[i].link + "'>" + response.data[i].link + "</a>";
		} else if (response.data[i].type == "status") {
			if (response.data[i].status_type) {
				if (response.data[i].status_type == "wall_post") {
					if (response.data[i].message) {
						outStr += ": " + response.data[i].message; 
					}
					if (response.data[i].story) {
						outStr += ": " + response.data[i].story; 
					}
				} else {
					outStr += ": " + response.data[i].status_type; 
				}
			} else {
				outStr += ": " + response.data[i].story; 
			}
		} else {
		
		}
		
		if (response.data[i].likes) {
			outStr += " | <b>likes: " + response.data[i].likes.data.length + "</b>";
		}
		if (response.data[i].comments) {
			outStr += " | <b>comments: " + response.data[i].comments.data.length + "</b>";
		}
		
		outStr += "<br>";
	}
	$('#outputProcessedData').html(outStr);
}